import React from "react";
import "../../styles/Home.css"; 
import "../../../src/index.css";
import NavTabs from "../NavTabs";


function Home() {
    return (
        <Router>
        <div>
          <NavTabs />
          <Route exact path = "/" component={Home}/>
          <Route exact path = "/learn" component={Learn}/>
          {/* <Route exact path= "/get-alerts" component={Alert}/> */}
          {/* <Route exact path = "/report" component = {Report}/> */}
        </div>

        <div className="home-body">
            <header className = "header">
                <h1 className = "title">CANNAHIRE</h1>
                <h4 className = "intro">Discover your career in the cannabis industry.</h4>
            </header>

            <div className="map-location">
            <form>
                <input type="text" className="location" placeholder="City, State, or Zipcode"></input>
                <button className = "search">Search</button><br></br>
                <button className = "login">Sign Up</button><br></br>
                <button className = "login">Login</button>
            </form>

            </div>

            <div className = "screenshots">
            <h3>Search and apply for jobs.</h3>
            <img href="" src ={require('../../assets/screenshot-placeholder.png')} alt=""></img>

            <h3>Learn about the cannabis market.</h3>
            <img href="" src ={require('../../assets/screenshot-placeholder.png')} alt=""></img>


            <h3>Track your career.</h3>
            <img href="" src ={require('../../assets/screenshot-placeholder.png')} alt=""></img>


            </div>
        </div>
        </Router>

    );
}

export default Home;
